import React, { useState, useLocation } from 'react';

import {
    BrowserRouter as Router,
    useHistory,
    Switch,
    Route,
    Link
} from "react-router-dom";
function History(props) {
    console.log(props);
    const location = useLocation();
    return (
        <div>
            <h2>History</h2>
            <h2>{location.client.Name}</h2>
        </div>
    );
}
export default History;
